import './Item.css';

function Item({ item }) {

  const date = new Date(item.registration_date).toLocaleDateString() || '-'

  return (
    <tr className="item" key={item.id}>
      <td className="item__td item--blue">{item.firstName}</td>
      <td className="item__td">{item.lastName}</td>
      <td className="item__td">{item.email}</td>
      <td className="item__td">{item.role}</td>
    </tr>
  );
}

export default Item;
